$(document).ready(function(){$("#selectArticle").on("change",function(){var t=$(this).val();$("#articles").empty();var e="https://api.nytimes.com/svc/topstories/v2/"+t+".json";e+="?"+$.param({"api-key":"bf7509976e704a8e9e899853b9a17f98"}),$.ajax({url:e,method:"GET"}).done(function(t){$.each(t.results.filter(function(t){return 0!==t.multimedia.length}).slice(0,12),function(t,e){var a=e.title,i=e.abstract,l=e.url;$("#articles").append('<li class="articles_clips" style="background-image: url('+e.multimedia[4].url+')"><a href="'+l+'"><h2 class="article_titles">'+a+"</h2><p>"+i+"</p></a></li>")})}).fail(function(t){throw t})})});